{
    vec2 uv = fragCoord/iResolution.y -0.5;

    float d = length(uv);
    float t = iTime*0.07;
    uv*=100.0;
    float e = abs(uv.x) + abs(uv.y) - t;
    float g = length(abs(uv)+1.1)*0.2;
    float k =  fract(  sin(  fract(sin(  fract(sin( e  )) * g )) * 3.7 )*1.01)*e*sin(iTime*0.2)*5.0;
    fragColor = vec4(k);
}
